package level1;

public class SwitchCase {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int tech =2;
		
		switch(tech) {
		case 1:
		{
			System.out.println("java");
			break;
			
		}
		case 2:
		{
			System.out.println("ASP");
			break;
			
		}
		default:
		{
			System.out.println("Not Listed..");
		}
		}

	}
}
